import React from 'react';
import { Link } from 'react-router-dom';

function Navbar() {
  return (
    <nav className="navbar">
      <img src="/Images/logo.jpg" alt="Restaurant Logo" className="navbar-logo" />
      <ul className="navbar-nav">
        <li className="nav-item"><Link to="/" className="nav-link">Home</Link></li>
        <li className="nav-item"><Link to="/menu-items" className="nav-link">Menu Items</Link></li>
        <li className="nav-item"><Link to="/orders" className="nav-link">Orders</Link></li>
        <li className="nav-item"><Link to="/reservations" className="nav-link">Reservations</Link></li>
      </ul>
    </nav>
  );
}

export default Navbar;
